電子レンジ対応エアバルブ仕様ですので、<br>
フタをしたまま電子レンジにかける事ができます。<br>
<br>
保存容器としても、お弁当箱としてＧｏｏｄ！<br>
<br>
○商品サイズ：約142×115×64mm<br>
○容　量：４３０ml<br>
<br>
・空炊きをしないでください<br>
<br>
・油分の多い食品、また、水分の少ない食品は<br>
　加熱時間を短くしてください<br>
<br>
・調理時の食品の量が少ない場合、加熱時間を<br>
　短くしてください<br>
<br>【Made in Japan】

