ランチにも持って行ける保存容器☆彡<br>
<br>
余ったおかずや薬味などの保存にもＧｏｏｄ！<br>
<br>
パッキン付きで、ネジ式タイプのフタだから、<br>
汁漏れしにくい (^.^)b<br>
